import { Component } from '@angular/core';
import { NOTES } from 'src/notes';
import { AllMessagesService } from '../../services/allMessages/all-messages.service';

@Component({
	selector: 'app-notes-list',
	templateUrl: './notes-list.component.html',
	styleUrls: ['./notes-list.component.scss'],
})
export class NotesListComponent {
	constructor(private allMessages: AllMessagesService) {}

	ngOnInit(): void {
		this.allMessages.getAllMessages().subscribe(
			(res: any) => {
				this.notes = res.data;
				console.log(this.notes);
			},
			(error) => {
				console.log(error);
			}
		);
	}

	notes = NOTES;
	search = '';
	searchDate = '';


	// search notes, filter by title or body text (case insensitive) and show results
	searchNotes() {
		if (this.search) {
			this.notes = this.notes.filter((note) => {
				return (
					note.title?.toLowerCase().includes(this.search.toLowerCase()) ||
					note.body?.toLowerCase().includes(this.search.toLowerCase())
				);
			});
		} else {
			this.ngOnInit();
		}
	}

	// search notes, filter by date and show results
	searchNotesByDate() {
		console.log(this.searchDate);
		if (this.searchDate) {
			const searchDate = new Date(this.searchDate as string); // assert this.searchDate as string

			const searchDateString = `${searchDate.getFullYear()}-${('0' + (searchDate.getMonth() + 1)).slice(-2)}-${('0' + searchDate.getDate()).slice(-2)}`;

			this.notes = this.notes.filter((note) => {
				const noteDate = new Date(note.updatedAt.split('T')[0] ); // get only the date part in "yyyy-mm-dd" format

				const noteDateString = `${noteDate.getFullYear()}-${('0' + (noteDate.getMonth() + 1)).slice(-2)}-${('0' + noteDate.getDate()).slice(-2)}`;

				return noteDateString === searchDateString;
			});
		} else {
			this.ngOnInit();
		}
	}
}
<main class="flex flex-col items-center justify-center gap-4">
	<h1>All Publications</h1>

	<div>
		<label
			class="text-center text-gray-500 text-sm w-full"
		>
			Words to Search?
		</label>
		<input
			type="text"
			placeholder="Search"
			class="input-group w-full rounded-3xl border-gray-300 border-2"
			[(ngModel)]="search"
			(input)="searchNotes()"
		/>
	</div>
	<div>
		<label
			class="text-center text-gray-500 text-sm w-full"
		>
			Date Select
		</label>
		<input
			type="date"
			placeholder="Search"
			class="input-group w-full rounded-3xl border-gray-300 border-2"
			[(ngModel)]="searchDate"
			(change)="searchNotesByDate()"
		/>
	</div>

	<ul class="flex flex-col items-center justify-center gap-4">
		<li *ngFor="let note of notes">
			<app-note
				[noteTitle]="note.title"
				[noteText]="note.body"
				[date]="note.updatedAt"
				[user]="note.User?.name"
			></app-note>
		</li>
	</ul>
</main>
